CREATE DEFINER=`root`@`localhost` PROCEDURE `spSelectOnPVal`(IN p_threshold DOUBLE)
BEGIN
  SELECT `dist`, `cutoff`, `t_o_id`, `connected`, KS_p, Chi2_10, Chi2_20, Chi2_50, Chi2_70 FROM results_ln 
  WHERE Chi2_10 >= p_threshold OR Chi2_20 >= p_threshold OR Chi2_50 >= p_threshold OR Chi2_70 >= p_threshold OR KS_p >= 0.05;
  
  SELECT `dist`, `cutoff`, `t_o_id`, `connected`, exponent, KS_p, Chi2_10, Chi2_20, Chi2_50, Chi2_70 FROM results_pl 
  WHERE Chi2_10 >= p_threshold OR Chi2_20 >= p_threshold OR Chi2_50 >= p_threshold OR Chi2_70 >= p_threshold OR KS_p >= 0.05;
END ;;
